window.bookSummaryJSON = "<p>Lumerian Knight Torrin Llahsab has spent months as a prisoner of the evil Vilitos with one goal, a single purpose...survive, escape, track an ancient artifact before it can be used to destroy more of his people.</p> <p>When an opportunity comes at last, he is moments from stealing an enemy ship and making his escape when he sees a beautiful human woman, bound and gagged, being tormented by the evil guards. Weak and injured, he risks everything to save the female. He is a protector. A defender. It’s what he is to his core and he cannot simply walk away....</p> <p>Light years from Earth, Nurse Juliette Rosen is having one hell of a bad week. Captured by aliens, put in chains and flown light years from home, she’s sure she’s going to end up as a science experiment, or worse. Until a gorgeous stranger risks everything to save her, nearly dying to break her free of the enemy ship. He’s beautiful, strong, and mortally wounded.</p> <p>The desire she feels is undeniable, but now it’s her turn to risk everything. Her life. Her freedom. The wild black market on an unknown alien world. And worst of all, the evil plans of a murderous alien ruler determined to take her as his next bride...and his next victim.</p> <p>Will her knight protector be able to steal the bride before it’s too late?</p>"; 
